import { useSelector, useDispatch } from 'react-redux'
import { loadUsers } from '../../redux/actions'
import './Home.css'

const Home = () => {
    const users = useSelector(state => state.users)
    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(loadUsers())
    }, [])

    return (
        <table>
        <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Address</th>
            <th>Action</th>
            </tr>
            
                
            
  
</table>

    )
}

export default Home


